\uc1 MECANICA DEL HECHO SEGUN VERSION ASEGURADO: 0Circulando por San Ignacio interseccion Av. Roca, pasa una persona corriendo y lo colisiono levemente, cae al piso, se levanta y se retira por sus medios. Sin intervencion ni de ambulancia. Aparentemente se econtraba alcoholizado. 
d AMPLIACION : 0 Te cuento, yo sirculaba x San Ignacio cuando estoy x cruzar avenida roca, pasa corriendo un muchacho que despues me dice que estaba apurado xq venia el colectivo. Lo choco con la trompa de mi auto, el se cae, me bajo le pregunto si esta bien si queria que llame una ambulancia, o lo lleve al hospital. Dijo que no que le dolia la mano y el brazo pero que estaba apurado. (aclaro que el muchacho estaba tomando, tenia mucho holor a alcohol). Le di mis datos y el numero de telefono. El me dio sus datos y que no tenia celular. Y en la semana me llamo un familiar pidiendome que le pague los remedios y los dias que no iba a poder trabajar. Y yo le dije que iba hacer la denuncia al seguro. Te mande x mail las fotos del auto nesecitas algo mas? Se quedo en la parada del colectivo. yo me fui
